        dataFeed = AggregatorV3Interface(chainLinkPriceFeed);
    }

    /**
     * Returns the latest answer.
     */
    function getLatestData() public view returns (int256) {
        // prettier-ignore
        (
            /* uint80 roundID */
            ,
            int256 answer,
            /*uint startedAt*/
            ,
            /*uint timeStamp*/
            ,
            /*uint80 answeredInRound*/
        ) = dataFeed.latestRoundData();
        return answer;
    }
}
"
